import { Component } from "react";
import "./NavbarStyles.css";

class Navbar extends Component{
    render(){
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">Apex Audit Insight</h1>

                <ul>
                    <link>
                    <i class="fa-solid fa-house-user"></i>
                    Home
                    </link>
                </ul>
            </nav>
        )
    }
}
